import React, { Component } from "react";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      title: "Alexandra Lu",
      headerLinks: [
        { title: "Home", path: "/" },
        { title: "Home", path: "/about" },
        { title: "Home", path: "/work" },
        { title: "Home", path: "/courses" },
        { title: "Home", path: "/resume" },
      ],
    };
  }

  render() {
    return <div>Hello</div>;
  }
}

export default App;
